Canadian Forces Base Downsview; adopted by City Council on Dec. 16, 1998.

Plant No. 1 (1929-1944) - 65 Carl Hall Road; 
Plant No. 2 (1940) - 75 Carl Hall Road; 
Garage No. 55 (1943); Workshop Building No. 58 (1943) - 400 Carl Hall Road

City Council included the following 10 buildings or building complexes on the property at 1133-1377 Sheppard Avenue West (Parc Downsview Park) on the City of Toronto Inventory of Heritage Properties at its meeting of July 8, 9, 10 and 11, 2014.

a.         Buildings 34, 35 and 36 (Plant Complex 3);
b.         Buildings 38 and 39 (Construction and Engineering Building);
c.         Building 40 (Storage Building and Workshop);
d.         Building 41 (Storage Building);
e.         Building 42 (Storage Building);
f.          Building 43 (Workshop);
g.         Building 100 (Administration Building);
h.         Building 103 (Fire Hall);
i.          Building 105 (Central Heating Plant No. 1); and
j.          Building 151 (Supply Depot).

